import React, { useEffect } from 'react';
import { connect } from 'react-redux';
import { keycloakAuth } from '../../redux';
import SpacesDashboard from '../SpacesDashboard/SpacesDashboard';

function Login(props, { keycloakAuth, authData}) {

    useEffect(() => {
        keycloakAuth();
    }, [])
/*
    console.log(authData);*/
    debugger;

    if (! authData.authenticated)
      return <p>You can't access </p>;
    else{
      switch(props.type){
        case "Spaces":
          return <SpacesDashboard />
        default:
          return null
        }
      }
}

const mapStateToProps = state => {
    return {
        authData: state.auth
    }
}

const mapDispatchToProps = dispatch => {
    return {
        keycloakAuth: () => dispatch(keycloakAuth())
    }
}

export default connect(
    mapStateToProps,
    mapDispatchToProps
)(Login)
